// src/pages/CarDetailPage.js
import React from 'react';
import CarDetail from '../components/CarDetail';

function CarDetailPage() {
  return (
    <div>
      <h1>Car Details</h1>
      <CarDetail />
    </div>
  );
}

export default CarDetailPage;
